Tweet Text:
@Laila_020 شكراً ليلى. بحياتي كإنسان مسلم سني ما حسيت بطائفية تجاه المسيحين بالعكس كنت حس إنه النظام المجرم ظلمهم مثل ما ظلمنا.
المسلمين السنة هم يلي حملوا فارس الخوري المسيحي بالمسجد الأموي بدمشق وهتفوا باسمه
والمسيحي فارس الخوري هو يلي مات وأوصى بقراءة القرآن في عزائه.

@Laila_020 المسيحيين شاركو أيضا في التحرير
الكل على قدر إستطاعته
المهم الوحدة ضد الأعداء

@Laila_020 انا من حماه 
الله يرحمها 
انتو اخوتنا

@Laila_020 دكتورة ليلى كلمة حق منك 
عسى ان تكوني ممن قال اللة فيهم :

(( وَلَتَجِدَنَّ أَقْرَبَهُمْ مَوَدَّةً لِلَّذِينَ آمَنُوا الَّذِينَ قَالُوا إِنَّا نَصَارَى ذَلِكَ بِأَنَّ مِنْهُمْ قِسِّيسِينَ وَرُهْبَانًا وَأَنَّهُمْ لَا يَسْتَكْبِرُونَ ۝))

@Laila_020 كنا نتمنى وجود جميلة القلب والروح الفنانه 
مي سكاف لتشهد لحظات سقوط الطاغيه 
وجميعنا ننبذ التطرف والغلو والعنصريه ومنهج اهل السنه منهج معتدل وواضح ،والارض تتسع للجميع .
